import React, { useState } from "react";
import { Data } from "../../datas/data";
import { Link } from "react-router-dom";

const Location = () => {
//   const [locations, setLocation] = useState(Data);


  return (
    <div>
      <h1>Location Page</h1>
      {Data.map((dat) => {
        return (
          <div key={dat.id}>
            <h4>{dat.title}</h4>
            <Link to={`/location/${dat.id}`}>
              <h4>{dat.title}</h4>
            </Link>
          </div>
        );
      })}
    </div>
  );
};

export default Location;
